void Switch_Init(void){
	//Initialize the Clock
	SYSCTL_RCGCGPIO_R |= 0x08;
	//NOP
	int i;
	for(i=0; i<5; i ++){
	}	
	//Setting I/0
	GPIO_PORTD_DIR_R &= 0xFE;
	//AFSEL off
	GPIO_PORTD_AFSEL_R &= 0xFE;
	//DEN on
	GPIO_PORTD_DEN_R |= 0x01;
}


void Intro_Music(void){
	Timer0_Init(Switch_Init, 7000);
}

void Welcome_Init(void){
	ST7735_DrawBitmap( 8, 50, falling, 113, 23);
	ST7735_DrawBitmap( 14, 80, bricks, 100, 24);
	ST7735_DrawBitmap( 1, 145, startbutton, 126, 9);
	Intro_Music();
	while((GPIO_PORTD_DATA_R & 0x01) != 0x01){}
	Timer0A_Stop();
}


int hs;
int x;
int avg=0;
int z=0;
void SysTick_Handler(void){
	int dat=0;
	
	//GPIO_PORTF_DATA_R ^= 0x04;
	//GPIO_PORTF_DATA_R ^= 0x04;
	ADC0_ISC_R = 0x0008;
	//ADCMail = ADC_In();
	//ADCStatus = 1;
	for(z=0; z<256; z ++){
		ADCMail = ADC_In();
		dat = dat + ADCMail;	
	}
	avg = dat / z;
	hs = avg/37;
}



int main(void){
	DisableInterrupts();
	TExaS_Init();
	ADC_Init();
	PortF_Init();
	Random_Init(1);
	DAC_Init();
	Switch_Init();
	ST7735_InitR(INITR_REDTAB);
	ST7735_FillScreen(0xFFFF);
	EnableInterrupts();
	Welcome_Init();
	DisableInterrupts();
	SysTick_Init();
	ST7735_FillScreen(0xFFFF);
	ST7735_DrawBitmap(0,20,black,128,30);
	EnableInterrupts();
	ST7735_SetCursor(0,0);
	WorkerInit();
	while(1){
		fall();
	}
	

}

